import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Layout } from './Layout';

import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
 <>
 <BrowserRouter>
 <App/>
 <Layout/>
 </BrowserRouter>
 </>,
  document.getElementById('root')
);
